// SPDX-License-Identifier: MIT

pragma solidity ^0.8.4;

import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/token/ERC1155/IERC1155.sol";
import "@openzeppelin/contracts/token/ERC1155/utils/ERC1155Holder.sol";

contract Marketplace is ERC1155Holder {
    using Counters for Counters.Counter;
    Counters.Counter public _tokenIds;
    Counters.Counter private _nftSold;
    IERC1155 private nftContract;
    address private owner;
    uint256 private platformFee = 25;

    constructor(address _nftContract) {
        nftContract = IERC1155(_nftContract);
    }

    struct NFTMarketItem {
        uint256 tokenId;
        uint256 nftId;
        uint256 amount;
        uint256 price;
        uint256 commision;
        address payable seller;
        address payable owner;
        bool isStopped;
    }

    mapping(uint256 => NFTMarketItem) public marketItem;
    mapping(uint256 => address) public nftOrigin;

    function listNft(
        uint256 nftId,
        uint256 amount,
        uint256 price,
        uint256 commision
    ) external {
        require(nftId > 0, "Token doesnot exist");
        require(commision >= 0, "commision should be between 0 to 30");
        require(commision < 29, "commision should be less than 30");

        _tokenIds.increment();
        uint256 tokenId = _tokenIds.current();

        marketItem[tokenId] = NFTMarketItem(
            tokenId,
            nftId,
            amount,
            price,
            commision,
            payable(msg.sender),
            payable(msg.sender),
            false
        );

        IERC1155(nftContract).safeTransferFrom(
            msg.sender,
            address(this),
            nftId,
            amount,
            ""
        );
        if (nftOrigin[nftId] == address(0)) {
            nftOrigin[nftId] = msg.sender;
        }
    }

    function buyNFT(uint256 tokenId) external payable {
        require(tokenId > 0, "invalid Token Id");
        require(marketItem[tokenId].owner != address(0), "Not On Sale");
        require(
            marketItem[tokenId].isStopped == false,
            "Sale Has Already Ended"
        );
        require(marketItem[tokenId].amount > 0, "Sold Out");
        uint256 price = marketItem[tokenId].price;

        require(
            marketItem[tokenId].owner != msg.sender,
            "Dude You're the owner"
        );
        uint256 commision = (price * marketItem[tokenId].commision) / 100;

        marketItem[tokenId].owner.transfer(msg.value - commision);
        _nftSold.increment();
        marketItem[tokenId].amount--;
        onERC1155Received(address(this), msg.sender, tokenId, 1, "");
        nftContract.safeTransferFrom(address(this), msg.sender, tokenId, 1, "");
    }

    function stopSale(uint256 tokenId) external {
        require(
            marketItem[tokenId].owner == msg.sender,
            "User Is Not the Owner of current NFT ID"
        );
        require(tokenId > 0, "Invalid tokenID");

        nftContract.safeTransferFrom(
            address(this),
            msg.sender,
            tokenId,
            marketItem[tokenId].amount,
            ""
        );
        marketItem[tokenId].amount;
        marketItem[tokenId].isStopped = true;
    }
}
